import { Box, Text } from '@chakra-ui/react';
import React from 'react';
import { WaveTideData } from '../types';

interface Props {
  wavesTideData: WaveTideData;
}

const WavesTideInfo: React.FC<Props> = ({ wavesTideData }) => {
  return (
    <Box mt={4}>
      <Text>
        Location: {wavesTideData.location}
      </Text>
      <Text>
        Wave Height: {wavesTideData.wave_height}
      </Text>
      <Text>
        Tide Height: {wavesTideData.tide_height}
      </Text>
      {/* Add other properties as needed */}
    </Box>
  );
};

export default WavesTideInfo;
